import React from 'react';
import { GlobalStyle, WeatherCard, MiInfo, SocialNetworkItem, BreakLine } from '../../styles/styles';
import { findLanguageByKey } from '../../languages/Languages';
import { useLocation } from 'react-router-dom';
const SocialNetwork = () => {
	const { state } = useLocation();
	const { actualLanguage } = state;

	const fullLanguage = findLanguageByKey(actualLanguage);
	const socialNetworks = fullLanguage.socialNetworks;
	return (
		<>
			<GlobalStyle />
			<WeatherCard>
				{fullLanguage.socialNetworks.networks.map((network) => (
					<SocialNetworkItem>
						{network.abbrebiation} {network.username}
					</SocialNetworkItem>
				))}
				<MiInfo>{socialNetworks.myInfo}</MiInfo>
				{socialNetworks.networks.map((network) => (
					<SocialNetworkItem>
						{network.abbrebiation} {network.username}
					</SocialNetworkItem>
				))}
			</WeatherCard>
		</>
	);
};

export default SocialNetwork;
